executeFunc(function stWhECbst(){if(typeof Centrifuge==="function"){const dsn=window.centrifugo_dsn;const token=window.centrifugo_token;if(!dsn||!token){return false}centrifuge=new Centrifuge("wss://"+dsn+"/connection/websocket",{token:token,getToken:function(ctx){return new Promise((resolve,reject)=>{fetch("/centrifugo/credentials/user",{method:"POST",headers:new Headers({"Content-Type":"application/json"}),body:JSON.stringify(ctx)}).then(res=>{if(!res.ok){throw new Error(`Unexpected status code ${res.status}`)}return res.json()}).then(data=>{resolve(data.token)}).catch(err=>{reject(err)})})},debug:typeof window.debug=="undefined"?false:window.debug});centrifuge.connect();return true}return false});